import { Link } from 'react-router-dom';

function Sidebar() {
    return (
        <div className="sidebar">
            <h2>LMS Dashboard</h2>
            <ul>
                <li><Link to="/courses">Courses</Link></li>
                <li><Link to="/assignments">Assignments</Link></li>
                <li><Link to="/grades">Grades</Link></li>
            </ul>
        </div>
    );
}

export default Sidebar;
